script: |
  super -f text -I q6420.spq | sort > q6420.out

inputs:
  - name: q6420.spq
    data: |
      SELECT DISTINCT * FROM tab1 (FORMAT parquet) AS cor0 WHERE NOT NULL BETWEEN col2 + ( 30 ) * 26 AND + + col0 * - - col1 * CAST ( - col0 * - col1 AS REAL );
  - name: tab1

outputs:
  - name: q6420.out
    data: |
